Hi <@U022YD6LGAU> could you please share your code with me? I managed to get this far, but it opens the redirect in the initial window and also in a new tab, instead of just a new tab:
Please see my code below:
&lt;script charset="utf-8" type="text/javascript" src="&lt;//js.hsforms.net/forms/embed/v2.js&gt;"&gt;&lt;/script&gt;
&lt;script&gt;
    hbspt.forms.create({
        region: "na1",
        portalId: "xxx",
        formId: "xxxx",
        onFormSubmitted: function($form, data) {
            // Check if a redirect URL is provided
            if (data.redirectUrl) {
                // Open the redirect URL in a new tab
                window.open(data.redirectUrl, '_blank');
            }
        }
    });
&lt;/script&gt;
